import { useEffect } from "react";

const ConfirmatoryPage = (step, setStep, userDetails, files) => {
  useEffect(() => {
    console.log("final page step:", step);
    console.log("final Page", userDetails);
    console.log("final Page, files ", files);
  });
  return (
    <>
      <h2>USER DETAILS FROM CONFIRMATPRY PAGE</h2>
    </>
  );
};

export default ConfirmatoryPage;
